GMH.prototype.nearestAirport=function(latLng) {
  var airport="";
  var distance=100000000;
  for(i in IATA) {
    x=IATA[i];
    lat2=x.lat;
    lng2=x.lng;
    var latLng2=new google.maps.LatLng(lat2, lng2);
    d=this.Haversine(latLng, latLng2);
    if(d<distance) {
      airport=x;
      airport.iata=i;
      distance=d;
    }
  }
  for(i in IOCA) {
    x=IOCA[i];
    lat2=x.lat;
    lng2=x.lng;
    d=this.Haversine(latLng, latLng2);
    if(d<distance) {
      airport=x;
      airport.ioca=i;
      distance=d;
    }
  }
  return [airport, distance];
}




